#pragma endregion 

void cpyCardback(const int tbC[][Cardback_Width]) {
	for (int i = 0; i < Cardback_Height; i++)
		for (int j = 0; j < Cardback_Width; j++)
			fillerCard[i][j] = tbC[i][j];
}
void drawMinionCardback(int x, int y) {
	cpyCardback(Minion_Cardback_ARRY);
	for (int i = 0; i < Cardback_Height; i++)
		for (int j = 0; j < Cardback_Width; j++)
			if (fillerCard[i][j] != 99)
				putpixel(x + j, y + i, fillerCard[i][j]);
}
void drawSpellCardback(int x, int y) {
	cpyCardback(Spell_Cardback_ARRY);
	for (int i = 0; i < Cardback_Height; i++)
		for (int j = 0; j < Cardback_Width; j++)
			if (fillerCard[i][j] != 99)
				putpixel(x + j, y + i, fillerCard[i][j]);
}
